data.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("rutracker.org")
{
/* HEADER TOP FIX */
HTML
{
    overflow-x: auto !important;
    padding-top: 50px !important;
}

.topmenu
{
    border-bottom: 1px solid #CFD4D8 !important;
    height: 27px !important;
    overflow: hidden !important;
}

#page_header
{
    background: #FFFFFF !important;
    padding-bottom: 3px !important;
    position: fixed !important;
    top: 0 !important;
    z-index: 999 !important;
}

#main-nav
{
    border-width: 1px 0px 0px 0px !important;
}


/* AD & SITE CLEANER */
DIV.post_wrap
{
    max-width: 95% !important;
    overflow: auto !important;
}

IMG.smile,
IFRAME,
FORM[action="thx.php"],
FORM[action="http://www.jobsmarket.ru"],
[src*="static.rutracker.org/avatars/"],
DIV[style="padding: 8px 0 0 0;"],
DIV[style="margin: 4px auto 6px; text-align: center;"],
DIV[style="padding: 8px 0 0;"][class="tCenter"],
.signature,
.posts,
.joined,
.from,
.flag,
.thx-container,
#page_footer,
#logo,
#latest_news,
#board_stats,
#ddest-bn-1,
#glad-1, #glad-idx,
#idx-3,
#bn-9d-1, #bn-tio-1, #begun-t-user, #begun-tr,
#adriver-468x60, #adriver-240x120, #rle-468x60, #qle-468x60, #looky-468x60,
#bn-nikita-1, #bn-nikita-2, #bn-nikita-3, #bn-nikita-4, #bn-nikita-5, #bn-nikita-6,
#ad-all_top, #ad-all_bottom,
#ad-index_left_1, #ad-index_left_2, #ad-index_left_3, #ad-index_left_4,
#owo-idx-1, #owo-idx-2, #owo-idx-3, #owo-idx-4, #owo-idx-5, #owo-idx-6, #mg-informers,
#fp-banner,
#copyright, .copyright,
.floatR
{
    display: none !important;
}

}

@-moz-document url-prefix("http://jira."), url-prefix("https://jira.") {

/* text-shadow: 0 0 5px rgba(255,255,200,0.9) !important}  */


/* FIX IT - 02.01.2019 */
iframe#wysiwygTextarea_ifr {
	height: 775px !important;
}





/* Background Color for FireFox and Google Chrome */
HTML.mozilla, HTML.webkit.chrome {
     background: black !important;
}


/* Main Background Color */
div:not([class="dashboard-item-header"]) and div:not([class="synchrony-tp"]) {
     background: black !important;
}
     /* JIRA - DashBoard - TitleBar Color - Icons */
     div.gadget-menu {
		background: transparent !important;
     }
	/* CONFLUENCE - EditMode - add Table */
     div.picker.picker-cell, div.table-picker-box {
		background: gray !important;
	}



.jira-dialog-heading, .jira-dialog-heading *, .buttons-container .buttons-container * .jira-dialog-content, .jira-dialog .jira-dialog-content, .jira-dialog .buttons-container {
     background: #1a1a1a !important;
     color: #ededed !important;
}

.atlassian-autocomplete .suggestions li {
     color: #ededed;
}

.issue-link-summary {
     color: #325b77 !important;
}
.pagination-view, .issue-list > li {
     background: #000000 !important;
}

.sla-tag.sla-tag-breached, code {
     color: #000000;
}
.ghx-swimlane-header:after, .ghx-heading:after, .ghx-issue .ghx-end, .ghx-swimlane-header:hover, .ghx-heading:hover, .ghx-issue .ghx-end:hover, #ghx-pool > div.ghx-swimlane > ul > li > div:hover .ghx-end, .ghx-issue, .ghx-issue.ghx-selected .ghx-end {
     background-color: transparent;
     box-shadow: none;
}
.ghx-column.ui-sortable {
     background: #4d4d4d !important;
}
#ghx-pool {
     background: inherit;
}
#ghx-column-headers .ghx-column, #ghx-column-headers .ghx-column * {
     background: #4d4d4d !important;
     border: none;
     color: #ededed;
}
#ghx-header {
     margin: 0;
}
.ghx-column-headers .ghx-column, .ghx-columns .ghx-column {
     background: #4d4d4d;
}
.ghx-flagged * {
     background-color: #8b0000;
}
.ghx-columns .ghx-busted, .ghx-columns .ghx-busted-max {
     background: #8b0000 !important;
}
.ghx-column h2 {
     color: #ededed !important;
}
.ghx-backlog-header, .ghx-end {
     background: #000000 !important;
     color: #ededed !important;
}
.aui-badge {
     background: #ededed !important;
     color: #000000 !important;
}
.ghx-everything-else {
     background: #000000 !important;
}
.wiki-edit-toolbar {
     background: #000000;
}
#issue-tabs > li {
     background: #000000 !important;
     color: #ededed;
}
#issue-tabs > li > a {
     background: #000000 !important;
     color: #ededed;
}
#issue-tabs > li.active > strong {
     background: #325b77 !important;
     color: #ededed;
}
.ops li, .ops li * {
     background: #000000 !important;
     color: #ededed;
}
.aui-list, .aui-list * {
     color: #ededed !important;
}
.aui-dialog .dialog-page-menu {
     background: #000000 !important;
}
.dropdown-text {
     background: #000000 !important;
}
html, body header nav.aui-header, body header nav.aui-header *:not(.jira-feedback-plugin-icon), body header.aui-page-panel-nav {
     background: #000000;
}
.ghx-header *, .issue-header-content, .aui-page-header *, .command-bar, .toggle-title, .saved-search-selector, .saved-search-selector *, .navigator-search, .aui-dropdown2, .aui-page-panel-nav {
     background: #000000 !important;
     color: #ededed !important;
}
.aui-sidebar-wrapper, #content .aui-page-panel-nav .tabs.vertical strong {
     background: #000000 !important;
     color: #42769a !important;
}
#content .aui-page-panel-nav .tabs.vertical a:focus, #content .aui-page-panel-nav .tabs.vertical a:hover, #content .aui-page-panel-nav .tabs.vertical a:focus *, #content .aui-page-panel-nav .tabs.vertical a:hover * {
     background: #4d4d4d !important;
}
.aui-navgroup-horizontal .aui-nav > .aui-nav-selected a, .aui-navgroup-vertical .aui-nav .aui-nav-selected a, .aui-nav-vertical .aui-nav .aui-nav-selected a, .aui-nav-selected > a {
     color: #42769a !important;
}

/* h3 - dashboard-item-title => für JIRA - DashBoard */
h1, h2, h3:not([class="dashboard-item-title"]), h4 {
     background: black !important;
     color: #009CA6 !important;
}

/* horizontal separator */
hr {
     border-block-color: #009CA6 !important;
     border-block-style: outset !important;
}

.user-content-block h1, .user-content-block h2, .user-content-block h3, .user-content-block h4, .user-content-block h5, .user-content-block h6, .user-content-block:hover h1, .user-content-block:hover h2, .user-content-block:hover h3, .user-content-block:hover h4, .user-content-block:hover h5, .user-content-block:hover h6 {
     color: #FFFFFF !important;
}
#footer, #footer * {
     background: #000000 !important;
}



th {
     background: #000000 !important;
}

/* td:not([class = "highlight-green confluenceTd"]) */
td  {
     background: #000000 !important;
}

li {
     background: transparent !important;
}

a {
     color: #5985c6 !important;
     
}

body {
     background: #000000 !important;
}
select {
     background: #000000 !important;
     color: #5985c6 !important;
}

span:not([class="macro-icon-holder"]), span:not([class="aui-icon.aui-icon-small.aui-iconfont-vid-full-screen-on"]) {
     background: #000000 !important;
     color: #5985c6;
}

.aui-message.hint, .aui-message-hint, .aui-message.info, .aui-message-info, .aui-message, .aui-message.hint *, .aui-message-hint *, .aui-message.info *, .aui-message-info *, .aui-message * {
     background: #4d4d4d !important;
}
.aui-dialog2-header, .aui-dialog2-footer, .aui-dialog2-header *, .aui-dialog2-footer * {
     background: #4d4d4d !important;
     color: #ededed !important;
}
.aui-message {
     color: #ededed !important;
}


.layout .column .placeholder, .layout .column.empty .empty-text {
     background: #4d4d4d !important;
}
div#slider-wrapper {
     background: #4d4d4d !important;
}


/* Main Background Color 2 */
.content-container, .bf-gs-content, .bf-gs-section, * {
     background: #000000;
     color: #ededed;
     text-shadow: none !important;
     box-shadow: none !important;
}

/* Main Background Color 2 */
input.text {
	color: aqua !important;
}



/* 
----------------------------------------------------------------------
                              JIRA
----------------------------------------------------------------------
*/

/* JIRA - Sticky Command Bar */ 
@-moz-document url-prefix() {
div.command-bar {
	position: fixed !important;
	top: 57px !important;
	z-index: 100 !important;
	background: transparent !important;
     }
/* JIRA - Header - Page */ 
header.aui-page-header {
	width: 100% !important;
     margin-top: 40px !important;
	}
}

/* JIRA - Sticky Side Bar */ 
div#viewissuesidebar {
     position: fixed !important;
     width: 24% !important;
}

/* JIRA - width from Body */ 
div.aui-group .aui-item {
     width: 65% !important;
}

/* JIRA - Annoncement-Banner */ 
/*
div#announcement-banner.alertHeader{
     border-color: yellow !important;
     border-radius: 20px !important;
     border-style: inset !important;
     border-width: 8px !important;
}
*/

/* JIRA - Filter, Textboxen - Textarea */
textarea {
     color: white !important;
}

/* JIRA - Vorgang / Übersicht; Vorgangsnavigator - Hover */
tr:hover * {
     /* background: dark#009CA6 !important; */
     background: gray !important;
     color: white !important;
}


/* JIRA - Vorgangsnavigator - Suchergebnisser */
div.quick-search-result-group * {
     /* background: dark#009CA6 !important; */
     background: black !important;
}

/* JIRA - connection-error */
p.connection-error * {
     background: red !important;
}

/* JIRA - Linkes Menü; Menüleiste; Vorgangsnavigator - Hover */
a:hover * {
     background: gray !important;
     color: white !important;
}

/* JIRA - Vorang neu Erstellen Dialog - Head + Foot */
.jira-dialog-heading, .jira-dialog-heading *, .buttons-container .buttons-container * .jira-dialog-content, .jira-dialog .jira-dialog-content, .jira-dialog .buttons-container {
     background: black !important;
}

/* JIRA - Vorang neu Erstellen Dialog - DropDownMenus as Fields */
.aui-ss.aui-ss-select > .aui-ss-field:not(.active) {
	border-color: white !important;
}

/* JIRA - Vorang neu Erstellen Dialog - DropDownMenus as Field-Content (active) */
ul.aui-last  {
	background: #009CA6 !important;
}

/* JIRA - Vorang neu Erstellen Dialog - DropDownMenus as Field-Content (active) */
ul.aui-list-section {
	background: #009CA6 !important;
}

/* JIRA - Vorang neu Erstellen Dialog - DropDownMenus as Field-Content (active) */
div.suggestions.dropdown-ready {
	background-color: black !important;
}

/* JIRA - Vorang neu Erstellen Dialog - DropDownMenus as Field-Content (not active) */
.aui-list-item:not(.active) {
	background: black !important;
	color: red !important;
}


/* JIRA - Vorang neu Erstellen Dialog - DropDownMenus (Version) */
form.aui .jira-multi-select.long-field, .jiraform .jira-multi-select.long-field, form.aui .jira-multi-select.long-field > textarea, .jiraform .jira-multi-select.long-field > textarea {
	border-color: white !important;
}


/* JIRA - Vorang neu Erstellen Dialog - Checkboxes */
form.aui .checkbox > label, form.aui .radio > label {
    color: white !important;
}


/* JIRA - Vorang neu Erstellen Dialog - Highlighting - Fields */
form.aui:not(.aui-legacy-forms) .password:hover, form.aui:not(.aui-legacy-forms) .select:hover, form.aui:not(.aui-legacy-forms) .text:hover, form.aui:not(.aui-legacy-forms) .textarea:hover {
    border-color: #009CA6 !important;
}


/* JIRA - Vorgänge - DropwDown - Highlighting */
.aui-dropdown2:hover, .aui-dropdown2.aui-style-default a {
     background: black !important;
     color: #009CA6 !important;    
}

/* JIRA - Vorgänge - DropwDown - Hover */
.aui-dropdown2 li:hover, .aui-dropdown2 li *:hover {
     background: turquoise !important;
     color: black !important;
     border-radius: 12px;
}

/* JIRA - Suche - Highlighting + Hover */
.RecentContentItem_result-item-container__iBkZU:hover, .RecentContentItem_result-item-container__iBkZU:focus *, .RecentSpaceItem_recent-space-item-component__1oCK5:hover, .RecentSpaceItem_recent-space-item-component__1oCK5:focus * {
     background: white !important;
	border-radius: 12px;
	border-style: outset;
}

/* JIRA - Suche - Active */
a.icon-container.quick-search-active * {
     background: turquoise !important;
     color: black !important;
}

/* JIRA - Suche - MouseOver */
div.tipsy-inner {
     background: turquoise !important;
     color: black !important;
}


/* JIRA - User - MouseOver */
div.user-hover-info {
     background: black !important;
     border-color: #009CA6 !important;
	border-radius: 12px;
	border-style: outset;
}


/* JIRA - UserWatcher - MouseOver */
div.aui-inline-dialog-contents {
     background: black !important;
	border-radius: 12px;
	border-style: outset;
     border-color: #009CA6 !important;
}


/* JIRA - DashBoard - ProgressBar */
.sprint-health-dashboard-item li.ag-inprogress {
	background: darkred !important;
}

/* JIRA - DashBoard - ProgressBar */
.sprint-health-dashboard-item .ag-progress {
	background: darkgreen !important;
}

/* JIRA - DashBoard - ProgressBar */
.content-container, .bf-gs-content, .bf-gs-section, *:not(.dashboard-item-header) {
	background: transparent !important;
}

/* JIRA - DashBoard - ICON_Info -  "keine Daten verfügbar" */
.aui-message-info::after {
	color: red !important;
}

/* JIRA - DashBoard - ICON_Warning -  "Der ausgewählte Sprint für dieses Gadget ist momentan nicht aktiv." */
.aui-message-warning::after {
	color: orange !important;
}

/* JIRA - DashBoard - TEXTBOX_Warning - "Der ausgewählte Sprint für dieses Gadget ist momentan nicht aktiv." */
div.aui-message.aui-message-warning.warning {
     background: #424949 !important;
}

/* JIRA - DashBoard - TEXTBOX_Info - "keine Daten verfügbar"" */
div.aui-message.aui-message-info.info {
     background: #424949 !important;
}



/* JIRA - Create new Issue */
a#create_link.aui-button.aui-button-primary.aui-style.create-issue  {
	background-color: transparent !important;
}


/* JIRA - MessageBox new Issue created */
div.aui-message.closeable.aui-message-success.aui-will-closee  {
	background-color: turquoise !important;
}



/* JIRA - FAV - UNSTAR */
*.fav-link.aui-icon.aui-icon-small.disabled.aui-iconfont-unstar {
     color: gray !important;
}

/* JIRA - FAV - STAR */
*.fav-link.aui-icon.aui-icon-small.aui-iconfont-star.enabled {
     color: turquoise !important;
}


/* 
----------------------------------------------------------------------
						CONFLUENCE
----------------------------------------------------------------------
*/


/* CONFLUENCE - Sticky Header */ 
div#main-header.overlay-header {
     position: fixed !important;
     top: 40px !important;
     z-index: 100 !important;
}


th.confluenceTh * {
     background: black !important;
}
td.confluenceTd.highlight-grey * {
     background: black !important;
}


/* Header Section Change */
header#header.fixed-header * {
     background: black !important;
}

/* Message InfoBox */
div.aui-message.aui-message-info.info.closeable.shadowed, div.aui-message.aui-message-info.info.closeable.shadowed * {
     background: #009CA6 !important;
     color: black !important;
}

/* User Mouseover */
.ajs-content-hover * {
     background: black !important;
}

/* Userlinks - own / current user */
a.confluence-userlink.user-mention.current-user-mention {
     background: #009CA6 !important;
     color: black !important;
}

/* Userlinks - other users */
a.confluence-userlink.user-mention {
     background: gray !important;
     color: black !important;
}

/* Search and Replace */
mark.find-current {
     background: yellow !important;
     color: black !important;
}

/* Macro - by Select / Edit / Change - [Background Transparent] */
div.aui-blanket, div.shim {
     background: rgba(50, 150, 200, 0.5) !important;
}


/* Show corrupt Links */
#tinymce.wiki-content a.createlink {
     color: red !important;
}

/* Page - Edit Mode - other users - carret */
div.synchrony-tp {
     background: turquoise !important;
}

/* Page - Edit Mode - other users - carret */
.aui-popup.aui-dialog * {
     background: black !important;
}

/* Search Field - Live Search */
div.aui-dropdown.search-macro-dropdown.aui-dropdown-left * {
     background-color: black !important;
}


/* Marko - MoseOver Edit Panel */
div.aui-property-panel  {
     background-color: black !important;
}


/* Makro DropDownMenu */
div#insert-menu-options.aui-dropdown.grouped.aui-dropdown-left {
     background-color: black !important;
}



/* Table - by Select / Edit / Change - [Background Transparent] */
div#table-picker-backdrop {
     background: rgba(50, 150, 200, 0.5) !important;
}


/* Table - Highlight Colors */
td.highlight-green {
     Background: green !important;
}
td.highlight-red {
	Color: black !important;
     Background: red !important;
}
td.highlight-grey {
     Color: black !important;
     Background: gray !important;
}
td.highlight-yellow {
     Color: black !important;
     Background: yellow !important;
}
td.highlight-blue {
     Background: blue !important;
}


/* TABLE - HEADER */
th.confluenceTh, th.confluenceTh * {
     color: turquoise !important;
     Background: #4f4f4f !important;
}


/* TABLE - CHECKBOX - CHECKED */
li.checked {
	background-image: url(data:image/svg+xml;base64,) !important;
     background-repeat: no-repeat !important;
     background-color: darkgreen !important;
     background-size: 20px !important;
     
     color: white !important;
}


/* Body - Fallback: Background Color */
body#com-atlassian-confluence.theme-default.aui-layout.aui-theme-default {
     Background: black !important;
}


/*
----------------------------------------------------------------------
					     TICKET.IT
----------------------------------------------------------------------
*/


.custom-portal-layout-flag * {
     background: black !important;
}



/*
----------------------------------------------------------------------
					     GOOGLE
----------------------------------------------------------------------
*/

/* Search - SearchField */
input.gLFyf.gsfi {
     color: turquoise  !important;
}


}

@-moz-document domain("css-tricks.com") {
body.single-post,
body.single-screenshot {
    background: #100E17;
}

.on-light,
.on-light .article-content {
    background: #100E17;
    color: #fff;
}

.article-content h1,
.article-content h2,
.article-content h3,
.article-content h4,
.article-content h5, 
.article-content h6 {
    color: #FFF;
